const Dashboard = () => {
    return (
        <div className="row d-flex justify-content-center">
           <div className="col-md-3">
           <div className="col-md-3">
           <Sidebar/>
           </div>
           <div className="col-md-3">
           <Calendars/>
           </div>
            <div className="col-md-3">
            <AppointmentsByDate/>
           </div>
           
            
               </div>
            
        </div>
    );
};

export default Dashboard;
